options.template:
{% set must = {} %}

{% set filterQuery = [ {
  "multi_match": {
    "fields": [
      "live_search",
      "live_search._2gram",
      "live_search._3gram"
    ],
    "query": "%query%",
    "operator": "and", 
    "type": "bool_prefix"
        
  } } ] %}

{{ emsco_datatable(['preview'],['page'], {
    "protected": false,
    "frontendOptions": {
        "pageLength": 100
    },
    "query": {
        "bool": {
          "must": must|merge(filterQuery)
        }
      },
    "row_context": "{% set foo = 'bar' %}",
    "columns": [{
        "label": "Label",
        "template": '<a href="' ~ "{{path('data.revisions', {ouuid: data.id, type: data.contentType} ) }}"~'">' ~"{{ data.source.label }}</a>",
        "orderField": "label.alpha_order"
    },{
        "label": "Locale",
        "template": "{{ data.source.locale }}",
        "orderField": "locale"
    },{
        "label": "Draft",
        "template": "{{ foo|default('nope') }}"
    },{
        "label": "Published",
        "template": "{{ foo|default('nope') }}"
    },{
        "label": "Aligned",
        "template": "{{ foo|default('nope') }}"
    },{
        "label": "Path",
        "template": "{{ data.source.path }}",
        "orderField": "path"
    }]
}) }}


